    render() {
        return (
            <div className="nav-header-row">
                <div className="nav-header-row-logo">
                    <img src="./logo.png" alt="" id="logo"/>
                </div>
                <div className="nav-header-row-info"></div>
            </div>
        );
    }
}

export default Nav;
